import React, { Component } from 'react';
import Items from './items.js'

class List extends Component {
  constructor(props, context) {
    super(props, context);
    this.copiedState = this.props.todos;
  } 
    render() {
      return (
        <div className="List">
        {console.log(this.copiedState, "list")}
        <Items todos={this.copiedState}></Items>
        </div>
      );
    }
  }

  export default List;
